import React from 'react';
import {Nav, NavBtnLink, NavBtn} from 'react-router-dom';

export function TopNavBar() {

    return (
        <nav className="navbar fixed-top">
            <Nav>
                <NavBtn>
                    <NavBtnLink to='/signin'>Sign In</NavBtnLink>
                </NavBtn>
            </Nav>
      </nav>
    )
}
